  [],\n\t\"num_tags\": 0,\n\t\"name\": \"1997-fall-east-coast-noaa-usgs-nasa-airborne-lidar-assessment-of-coastal-erosion-alace-project-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes data collected from
  September to October 1997 and covers the states of South Carolina, North Carolina,
  Maryland, and Virginia. Laser beach mapping uses a pulsed laser ranging system mounted
  onboard an aircraft to measure ground elevation and coastal topography. The laser
  emits laser beams at high frequency and is directed downward at the earth's surface
  through a port opening in the bottom of the aircraft's fuselage. The laser system
  records the time difference between emission of the laser beam and the reception
  of the reflected laser signal in the aircraft. The aircraft travels over the beach
  at approximately 60 meters per second while surveying from the low water line to
  the landward base of the sand dunes.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
